import React from 'react';
import withRoot from '../../hocs/with-root';
import Header from '../../Components/containers/layouts/header';
import Hero from '../../Components/containers/hero';
import ProductValues from '../../Components/containers/product-values';
import ProductCategories from '../../Components/containers/product-categories';
import ProductHowItWorks from '../../Components/containers/product-how-it-works';
import ProductCTA from '../../Components/containers/product-cta';
import ProductSmokingHero from '../../Components/containers/product-smoking-hero';
import Footer from '../../Components/containers/layouts/footer';

function Index() {
  return (
    <React.Fragment>
      <Header />
      <Hero />
      <ProductValues />
      <ProductCategories />
      <ProductHowItWorks />
      <ProductCTA />
      <ProductSmokingHero />
      <Footer />
    </React.Fragment>
  );
}

export default withRoot(Index);
